vector: true

script: |
  super -f text -I q866.spq | sort > q866.out

inputs:
  - name: q866.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b);
  - name: t1

outputs:
  - name: q866.out
    data: |
      190
      222
      248
